INSERT INTO `settings` (`id`, `headerlogo`, `footerlogo`, `footercontent`, `trytitle`, `trydescription`, `trybuttontext`, `trybuttonlink`, `howitworktitle`, `howitworkcontent`, `created_at`, `updated_at`) VALUES
(1,	'setting/logo.svg',	'setting/logo.svg',	'State-of-the art software and equipment that allows you to provide showings to potential tenants without leaving your office or home, saving you time, energy, and money, while also being more convenient for your clients.',	'try',	'Schedule your free consultation today to learn more about how our services can help your agency.',	'free consultation',	'/contactus',	'Showings just got easier',	'<p><strong>Delet</strong>’s intuitive digital property showing software will have you renting out vacant properties with productivity, speed, and convenience.</p>',	'2022-06-13 03:07:19',	'2022-07-13 07:23:48');
